import React from 'react';

const Header: React.FC = () => {
    return (
        <header>
            <h1>Student Portal</h1>
            <nav>
                <ul>
                    <li><a href="#chatbot">Chatbot</a></li>
                    <li><a href="#bursary-info">Bursary Info</a></li>
                    <li><a href="#campus-navigation">Campus Navigation</a></li>
                    <li><a href="#food-ordering">Food Ordering</a></li>
                    <li><a href="#special-cases">Special Cases</a></li>
                    <li><a href="#module-selection">Module Selection</a></li>
                    <li><a href="#course-registration">Course Registration</a></li>
                </ul>
            </nav>
        </header>
    );
};

export default Header;
